import React, { Component } from "react";
import { connect } from "react-redux";

import { fetchUsersLastYear } from "../../../../redux/actions/KPI/UserLastYearAction";

import Barr from "./Bar";

class UsersLastYearBarChart extends Component {
  constructor(props) {
    super(props);

    this.state = {
      first: ["", ""],
      second: ["", ""],
      third: ["", ""],
      fourth: ["", ""],
      fifth: ["", ""],
      sixth: ["", ""],
      seventh: ["", ""],
      eighth: ["", ""],
      ninth: ["", ""],
      tenth: ["", ""],
      eleventh: ["", ""],
      twelfth: ["", ""],
    };
  }

  async componentDidMount() {
    const temp = await this.props.fetchUsersLastYear();

    const signups = this.props.usersLastYear.signups;

    this.setState({
      first: [signups[0].month, signups[0].count],
      second: [signups[1].month, signups[1].count],
      third: [signups[2].month, signups[2].count],
      fourth: [signups[3].month, signups[3].count],
      fifth: [signups[4].month, signups[4].count],
      sixth: [signups[5].month, signups[5].count],
      seventh: [signups[6].month, signups[6].count],
      eighth: [signups[7].month, signups[7].count],
      ninth: [signups[8].month, signups[8].count],
      tenth: [signups[9].month, signups[9].count],
      eleventh: [signups[10].month, signups[10].count],
      twelfth: [signups[1].month, signups[11].count]
    });
  }
  render() {
    const title = "Users Last Year";
    const yLabel = { value: "Users", angle: -90, position: "insideLeft" };
    const data = [
      {
        name: "1",
        value: this.state.first
      },
      {
        name: "2",
        value: this.state.second
      },
      {
        name: "6",
        value: this.state.third
      },
      {
        name: "10",
        value: this.state.fourth
      },
      {
        name: "12",
        value: this.state.sixth
      },
      {
        name: "16",
        value: this.state.seventh
      },
      {
        name: "20",
        value: this.state.eighth
      },
      {
        name: "24",
        value: this.state.ninth
      },
      {
        name: "28",
        value: this.state.tenth
      },
      {
        name: "30",
        value: this.state.eleventh
      },
      {
        name: "30",
        value: this.state.eleventh
      }
    ];

    return (
      <div>
        <Barr title={title} data={data} yLabel={yLabel} />
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    usersLastYear: state.KPI.usersLastYear
  };
};

export default connect(mapStateToProps, { fetchUsersLastYear })(
  UsersLastYearBarChart
);
